const classes = {
    container: {
        position: 'absolute',
        marginTop: '20px',
        top: '0',
        left: '0',
        padding: '0',
        width: '100%',
        backgroundColor: bgColor,
        zIndex: '-5',
        height: '100vh',
        width: '100vw'
    },
    miniContainer: {
        backgroundColor: 'white',
        border: '1px solid gray'
    }
}

export {classes}
